import React, { Component } from 'react';
import Link from 'react-scroll';

import './mobileMenu.css'

class mobileMenu extends Component {

    render() {
        return (
            <div className="mobile-navbar">
                <button>
                    <div className="hamburger"><div></div></div>
                    <div className="menu">
                        <div>
                            <ul>
                                <li className="navbar-item">
                                    <input type="checkbox" className="toggler"></input>
                                    <Link
                                        activeClass="active"
                                        to="main"
                                        spy={true}
                                        smooth={true}
                                        offset={0}
                                        duration={500}
                                    >Main</Link>
                                </li>
                                <li className="navbar-item">
                                    <input type="checkbox" className="toggler"></input>
                                    <Link
                                        activeClass="active"
                                        to="projects"
                                        spy={true}
                                        smooth={true}
                                        offset={0}
                                        duration={500}
                                    >Projects</Link>
                                </li>
                                <li className="navbar-item">
                                    <input type="checkbox" className="toggler"></input>
                                    <Link
                                        activeClass="active"
                                        to="about"
                                        spy={true}
                                        smooth={true}
                                        offset={0}
                                        duration={500}
                                    >About</Link>
                                </li>
                                <li className="navbar-item">
                                    <input type="checkbox" className="toggler"></input>
                                    <Link
                                        activeClass="active"
                                        to="contact-section"
                                        spy={true}
                                        smooth={true}
                                        offset={0}
                                        duration={500}
                                    >Contact</Link>
                                </li>
                            </ul>
                        </div>
                    </div>
                </button>
            </div>
        )
    }
};

export default mobileMenu;
